import React from "react";
import PathConstants from "./pathConstants";

import Dashboard from "../page/DashBoard";

import {
  BrowserRouter as Router,
  Route,
  Navigate,
  Routes,
  RouterProvider,
  createBrowserRouter,
} from "react-router-dom";

const Home = React.lazy(() => import("../page/DashBoard"));
// other page components...
const About = React.lazy(() => import("../page/Header"));

const routesWeb = [{ path: PathConstants.HOME, element: Home }];

export default routesWeb;
